import React from 'react';
import Commande from './Commande';

const Commandes = (props) => {
    console.log(props.commandes)
    const commandes = props.commandes
    const commandesList = commandes.map(c => <Commande numero={c.numero} date={c.date} montant={c.montant} statut={c.statut}/>)
    return (
        <>
            {commandesList}
        </>
    );
}
export default Commandes;
